  return (
    <Card style={{ width: '18rem', marginLeft:"20%",bor }}>
    <Card.Body>
      <Card.Title style={{color:'#00b7ff'}}>Furniture customize</Card.Title>
      <Card.Text>
        I want a customized furniture with gold combination.
      </Card.Text>
